import React from 'react'

function Main() {
    const divStyle = {
        backgroundImage: `url(${require('../pexels-jaspereology-3199036.jpg')})`,
      };

  return (
    <div class="grid grid-cols-2 grid-gap-4 h-[100vh]">
  <div class="bg-blue-500 p-4">Div 1</div>
  <div className="w-64 h-64 bg-cover bg-no-repeat" style={divStyle}></div>
</div>

  )
}

export default Main
